From Wikipedia, the free encyclopedia

This article is about the Rothschild banking family of England. For the family overview, see Rothschild family and for a bank founded by the family see N M Rothschild &amp; Sons

The Rothschild banking family of England was founded in 1798 by Nathan Mayer von Rothschild (1777-1836) who first settled in Manchester but then moved to London. Nathan was sent there from his home in Frankfurt by his father, Mayer Amschel Rothschild (1744-1812). Wanting his sons to succeed on their own and to expand the family business across Europe, Mayer Amschel Rothschild had his eldest son remain in Frankfurt, while his four other sons were sent to different European cities to establish a financial institution to invest in business and provide banking services. Nathan Mayer von Rothschild, the third son, first established a textile jobbing business in Manchester and from there went on to establish N M Rothschild &amp; Sons bank in London.

Intermarriage within the family was an essential part of the Rothschild strategy in order to ensure control of their wealth remained in family hands. From the home base in Frankfurt, Rothschild sons not only established themselves in England but also in Paris, Vienna and Naples in the Two Sicilies. Through their collaborative efforts, the Rothschilds rose to prominence in a variety of banking endeavours including loans, government bonds and trading in bullion. Their financing afforded investment opportunities and during the 19th century they became major stakeholders in large-scale mining and rail transport ventures that were fundamental to the rapidly expanding industrial economies of Europe.
